>>> .order_box {
  .head {
    padding: 30px 35px 25px;

    .full {
      display: flex;

      .iconfont {
        color: #1890FF;

        &.sale-after {
          color: #90ADD5;
        }
      }

      .text {
        align-self: center;
        flex: 1;
        min-width: 0;
        padding-left: 12px;
        border: 0;
        font-size: 13px;
        line-height: 13px;
        color: #606266;

        .title {
          margin-bottom: 10px;
          font-weight: 500;
          font-size: 16px;
          line-height: 16px;
          color: rgba(0, 0, 0, 0.85);
        }
      }

      .ivu-btn {
        margin-left: 12px;

        &:first-child {
          display: inline-block;
          border-color: #1890FF;
          margin-left: 0;
          background-color: #1890FF;
          color: #FFFFFF;
        }

        &:nth-child(2) {
          display: inline-block;
          border-color: #19BE6B;
          background-color: #19BE6B;
          color: #FFFFFF;
        }

        &:nth-child(3) {
          display: inline-block;
        }

        &:focus {
          box-shadow: none;
        }
      }

      .ivu-dropdown {
        margin-left: 12px;

        &:nth-child(n+5) {
          display: inline-block;
        }

        .ivu-btn {
          border-color: #DCDEE2;
          background-color: #FFFFFF;
          color: #515A6E;
        }
      }
    }

    .list {
      display: flex;
      margin-top: 20px;
      overflow: hidden;
      list-style: none;

      .item {
        flex: none;
        width: 200px;
        font-size: 14px;
        line-height: 14px;
        color: rgba(0, 0, 0, 0.85);

        .title {
          margin-bottom: 12px;
          font-size: 13px;
          line-height: 13px;
          color: #666666;
        }

        .value1 {
          color: #F56022;
        }

        .value2 {
          color: #1BBE6B;
        }

        .value3 {
          color: #1890FF;
        }

        .value4 {
          color: #6A7B9D;
        }

        .value5 {
          color: #F5222D;
        }
      }
    }
  }

  .section {
    padding: 25px 0;
    border-bottom: 1px dashed #EEEEEE;

    .title {
      padding-left: 10px;
      border-left: 3px solid #1890FF;
      font-size: 15px;
      line-height: 15px;
      color: #303133;
    }

    .list {
      display: flex;
      flex-wrap: wrap;
      list-style: none;
    }

    .item {
      flex: 0 0 calc((100% / 3));
      display: flex;
      margin-top: 16px;
      font-size: 13px;
    }
  }
}

color #606266 {
  &:nth-child(3n+1) {
    padding-right: 20px;
  }

  &:nth-child(3n+2) {
    padding-right: 10px;
    padding-left: 10px;
  }

  &:nth-child(3n+3) {
    padding-left: 20px;
  }
}

.value {
  flex: 1;

  .image {
    display: inline-block;
    width: 40px;
    height: 40px;
    margin: 0 12px 12px 0;
    vertical-align: middle;
  }

  img {
    width: 100%;
    height: 100%;
  }
}

.product {
  // display flex
  .image {
    width: 50px;
    height: 50px;
    display: inline-block;
    vertical-align: middle;
  }

  img {
    width: 100%;
    height: 100%;
    border-radius: 4px;
  }

  .title {
    width: calc(100% - 63px);
    padding-left: 13px;
    text-align: left;
    display: inline-block;
    vertical-align: middle;
  }
}

>>> .ivu-tabs {
  color: rgba(0, 0, 0, 0.85);

  .ivu-tabs-bar {
    border-bottom: 0;
    margin-bottom: 0;
    background-color: #F5F7FA;
  }

  .ivu-tabs-nav-container {
    font-size: 13px;
  }

  .ivu-tabs-nav-wrap {
    margin-bottom: 0;
  }

  .ivu-tabs-ink-bar {
    display: none;
  }

  .ivu-tabs-tab {
    padding: 7px 19px !important;
    margin-right: 0;
    line-height: 26px;
  }

  .ivu-tabs-tab-active {
    background-color: #FFFFFF;
    color: rgba(0, 0, 0, 0.85);

    &::before {
      content: '';
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 2px;
      background-color: #1890FF;
    }
  }

  .ivu-tabs-tabpane {
    padding: 15px;

    &:first-child {
      padding: 0 25px;
    }
  }
}

>>> .ivu-table {
  .ivu-table-header {
    table {
      border-top: 0 !important;
    }

    th {
      background-color: #F7F7F7 !important;
    }
  }
}
